INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (0, 1, 24001, "2030/12/17 14:59:59", 24, 0.0, "あたしだって\nやるときはやるよ！", 10040, 0.0, "リン", 1, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (1, 1, 24002, "2030/12/17 14:59:59", 24, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 0.0, "リン", 1, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (2, 1, 24003, "2030/12/17 14:59:59", 24, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 0.0, "リン", 1, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (3, 2, 24004, "2030/12/17 14:59:59", 24, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 10040, 0.0, "リン", 2, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (4, 1, 24005, "2030/12/17 14:59:59", 24, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 0.0, "リン", 1, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (5, 2, 24006, "2030/12/17 14:59:59", 24, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 0.0, "リン", 2, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (6, 2, 24007, "2030/12/17 14:59:59", 24, 0.0, "あたしも意外と\nやるもんでしょ？", 10040, 0.0, "リン", 2, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (7, 4, 24008, "2030/12/17 14:59:59", 24, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 0.0, "リン", 4, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (8, 4, 24009, "2030/12/17 14:59:59", 24, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 0.0, "リン", 4, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (9, 4, 24010, "2030/12/17 14:59:59", 24, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 10040, 0.0, "リン", 4, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (10, 4, 24011, "2030/12/17 14:59:59", 24, 0.0, "やられた…\nねずみって意外と\nてごわいね", 10040, 0.0, "リン", 4, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (11, 4, 24012, "2030/12/17 14:59:59", 24, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 0.0, "リン", 4, 102601, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_d1f7812692e05b315d378e41d9110c0334f02f98680f039ae0a256da44799ad7` VALUES (12, 4, 24013, "2030/12/17 14:59:59", 24, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 0.0, "リン", 1, 102601, 1.81, "2020/04/30 12:00:00");
